import React from 'react';
import './AboutProject.css';
import '../NavTab/NavTab.css'

export default function AboutProject(){
    return(
        <aboutproject className='aboutproject'>
            <h1 className='aboutproject_title'>Технологии</h1>
            <div className='aboutproject_line' />
            <h2 className='aboutproject_subtitle'>7 технологий</h2>
            <p className='aboutproject_text'>На курсе веб-разработки мы освоили технологии, которые применили в дипломном проекте.</p>
            <div className='aboutproject_blocks'>

            </div>
        </aboutproject>
    )
}
